pragma solidity ^0.8.20;


import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title HashedTimeLockEscrow
 * @dev A hashed time-lock escrow contract for cross-chain payments, allowing secure transactions between parties by locking funds until certain conditions are met.
 */
contract HashedTimeLockEscrow is Ownable {
    address public sender;
    address public receiver;
    bytes32 public hashlock;
    uint256 public timelock;
    uint256 public amount;
    bool private isWithdrawn;
    bool private isRefunded;

    /// @dev Emitted when the HTLC is initiated.
    event Initiated(address indexed sender, address indexed receiver, uint256 amount, bytes32 hashlock, uint256 timelock);

    /// @dev Emitted when the funds are withdrawn by the receiver.
    event Withdrawn(address indexed receiver, uint256 amount);

    /// @dev Emitted when the funds are refunded to the sender.
    event Refunded(address indexed sender, uint256 amount);

    /// @dev Ensures that the function is called only by the sender.
    modifier onlySender() {
        if (msg.sender != sender) revert UnauthorizedSender();
        _;
    }

    /// @dev Ensures that the function is called only by the receiver.
    modifier onlyReceiver() {
        if (msg.sender != receiver) revert UnauthorizedReceiver();
        _;
    }

    /// @dev Ensures that the funds have not been withdrawn yet.
    modifier fundsNotWithdrawn() {
        if (isWithdrawn) revert FundsAlreadyWithdrawn();
        _;
    }

    /// @dev Ensures that the funds have not been refunded yet.
    modifier fundsNotRefunded() {
        if (isRefunded) revert FundsAlreadyRefunded();
        _;
    }

    /// @dev Error for unauthorized sender access.
    error UnauthorizedSender();

    /// @dev Error for unauthorized receiver access.
    error UnauthorizedReceiver();

    /// @dev Error for funds already withdrawn.
    error FundsAlreadyWithdrawn();

    /// @dev Error for funds already refunded.
    error FundsAlreadyRefunded();

    /// @dev Error for invalid address.
    error InvalidAddress();

    /// @dev Error for invalid amount.
    error InvalidAmount();

    constructor() Ownable(msg.sender) {}

    /**
     * @notice Initiates the HTLC by setting the receiver, hashlock, timelock, and locking the funds.
     * @param _receiver The address of the receiver.
     * @param _hashlock The hashlock condition for the HTLC.
     * @param _timelock The time until which the funds are locked.
     */
    function initiate(address _receiver, bytes32 _hashlock, uint256 _timelock) external payable onlyOwner {
        if (_receiver == address(0)) revert InvalidAddress();
        if (msg.value == 0) revert InvalidAmount();

        sender = msg.sender;
        receiver = _receiver;
        hashlock = _hashlock;
        timelock = _timelock;
        amount = msg.value;

        emit Initiated(sender, receiver, amount, hashlock, timelock);
    }

    /**
     * @notice Allows the receiver to withdraw the funds by providing the correct preimage.
     * @param preimage The preimage that hashes to the hashlock.
     */
    function withdraw(bytes32 preimage) external onlyReceiver fundsNotWithdrawn fundsNotRefunded {
        if (keccak256(abi.encodePacked(preimage)) != hashlock) revert UnauthorizedReceiver();

        isWithdrawn = true;
        emit Withdrawn(receiver, amount);

        (bool success, ) = receiver.call{value: amount}("");
        require(success, "Transfer failed");
    }

    /**
     * @notice Allows the sender to refund the funds if the timelock has expired and the funds have not been withdrawn.
     */
    function refund() external onlySender fundsNotWithdrawn fundsNotRefunded {
        if (block.timestamp < timelock) revert UnauthorizedSender();

        isRefunded = true;
        emit Refunded(sender, amount);

        (bool success, ) = sender.call{value: amount}("");
        require(success, "Transfer failed");
    }
}

